import React from 'react'
import ReactDOM from 'react-dom'

import {
    App, Time
} from './components'

function Nav() {
    return (
    <nav>
        <ul>
            <li>Pricing</li>
            <li>About</li>
            <li>Contact</li>
        </ul>
    </nav>
    )
}

ReactDOM.render(
    //<div><App/><Time/></div>,
    <Nav />,
    document.getElementById('root')
)
